import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import { adminAPI } from '../services/api';

interface AdminStats {
  totalUsers: number;
  totalPosts: number;
  publishedPosts: number;
  totalClicks: number;
  totalEarnings: number;
  recentSearches: Array<{
    query_text: string;
    results_count: number;
    searched_at: string;
  }>;
  topPosts: Array<{
    title: string;
    click_count: number;
    total_earnings: number;
    username: string;
  }>;
}

const AdminDashboard: React.FC = () => {
  const [stats, setStats] = useState<AdminStats | null>(null);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState('');

  useEffect(() => {
    fetchStats();
  }, []);

  const fetchStats = async () => {
    try {
      setLoading(true);
      const response = await adminAPI.getStats();
      setStats(response);
    } catch (err: any) {
      setError(err.response?.data?.message || 'Failed to load admin statistics');
    } finally {
      setLoading(false);
    }
  };

  const processEarnings = async () => {
    try {
      await adminAPI.processEarnings();
      alert('ÏàòÏùµ Ï≤òÎ¶¨Í∞Ä ÏôÑÎ£åÎêòÏóàÏäµÎãàÎã§.');
      fetchStats(); // Refresh stats
    } catch (err: any) {
      alert('ÏàòÏùµ Ï≤òÎ¶¨Ïóê Ïã§Ìå®ÌñàÏäµÎãàÎã§: ' + (err.response?.data?.message || 'Unknown error'));
    }
  };

  if (loading) {
    return (
      <div className="flex items-center justify-center min-h-screen">
        <div className="w-32 h-32 border-b-2 border-blue-600 rounded-full animate-spin"></div>
      </div>
    );
  }

  if (!stats) {
    return (
      <div className="px-4 py-8 mx-auto max-w-7xl sm:px-6 lg:px-8">
        <div className="p-4 text-red-600 border border-red-200 rounded bg-red-50">
          {error}
        </div>
      </div>
    );
  }

  return (
    <div className="px-4 py-8 mx-auto max-w-7xl sm:px-6 lg:px-8">
      <div className="mb-8">
        <h1 className="text-3xl font-bold text-gray-900">Í¥ÄÎ¶¨Ïûê ÎåÄÏãúÎ≥¥Îìú</h1>
        <p className="text-gray-600">ÏãúÏä§ÌÖú Ï†ÑÎ∞òÏùò ÌÜµÍ≥ÑÏôÄ Í¥ÄÎ¶¨ Í∏∞Îä•ÏùÑ Ï†úÍ≥µÌï©ÎãàÎã§.</p>
      </div>

      {error && (
        <div className="px-4 py-3 mb-6 text-red-600 border border-red-200 rounded bg-red-50">
          {error}
        </div>
      )}

      {/* Quick Actions */}
      <div className="grid grid-cols-1 gap-6 mb-8 md:grid-cols-2 lg:grid-cols-4">
        <Link
          to="/admin/posts"
          className="p-6 text-center text-white transition-colors bg-blue-600 rounded-lg hover:bg-blue-700"
        >
          <div className="text-2xl font-bold">{stats.totalPosts}</div>
          <div className="text-sm">Ìè¨Ïä§Ìä∏ Í¥ÄÎ¶¨</div>
        </Link>

        <Link
          to="/admin/users"
          className="p-6 text-center text-white transition-colors bg-green-600 rounded-lg hover:bg-green-700"
        >
          <div className="text-2xl font-bold">{stats.totalUsers}</div>
          <div className="text-sm">ÏÇ¨Ïö©Ïûê Í¥ÄÎ¶¨</div>
        </Link>

        <Link
          to="/admin/contacts"
          className="p-6 text-center text-white transition-colors bg-yellow-600 rounded-lg hover:bg-yellow-700"
        >
          <div className="text-2xl font-bold">üìß</div>
          <div className="text-sm">Î¨∏Ïùò Í¥ÄÎ¶¨</div>
        </Link>

        <button
          onClick={processEarnings}
          className="p-6 text-center text-white transition-colors bg-purple-600 rounded-lg hover:bg-purple-700"
        >
          <div className="text-2xl font-bold">üí∞</div>
          <div className="text-sm">ÏàòÏùµ Ï≤òÎ¶¨</div>
        </button>
      </div>

      {/* Statistics Cards */}
      <div className="grid grid-cols-1 gap-6 mb-8 md:grid-cols-2 lg:grid-cols-5">
        <div className="p-6 bg-white rounded-lg shadow">
          <div className="text-2xl font-bold text-gray-900">{stats.totalUsers}</div>
          <div className="text-sm text-gray-600">Ï¥ù ÏÇ¨Ïö©Ïûê</div>
        </div>

        <div className="p-6 bg-white rounded-lg shadow">
          <div className="text-2xl font-bold text-gray-900">{stats.totalPosts}</div>
          <div className="text-sm text-gray-600">Ï¥ù Ìè¨Ïä§Ìä∏</div>
        </div>

        <div className="p-6 bg-white rounded-lg shadow">
          <div className="text-2xl font-bold text-gray-900">{stats.publishedPosts}</div>
          <div className="text-sm text-gray-600">Î∞úÌñâÎêú Ìè¨Ïä§Ìä∏</div>
        </div>

        <div className="p-6 bg-white rounded-lg shadow">
          <div className="text-2xl font-bold text-gray-900">{stats.totalClicks.toLocaleString()}</div>
          <div className="text-sm text-gray-600">Ï¥ù ÌÅ¥Î¶≠</div>
        </div>

        <div className="p-6 bg-white rounded-lg shadow">
          <div className="text-2xl font-bold text-gray-900">${Number(stats.totalEarnings || 0).toLocaleString()}</div>
          <div className="text-sm text-gray-600">Ï¥ù ÏàòÏùµ</div>
        </div>
      </div>

      <div className="grid grid-cols-1 gap-6 lg:grid-cols-2">
        {/* Top Earning Posts */}
